import mongoose from 'mongoose';

const MealSchema = mongoose.Schema({
  user: {
    type: mongoose.Schema.Types.ObjectId,
    ref: 'users'
  },
  calories: {
    type: String
  },
  fat: {
    type: String
  },
  date: {
    type: Date,
    default: Date.now
  }
});

const Meal = mongoose.models.Meal || mongoose.model('meal', MealSchema);
